import React from 'react'
import AppLayout from "./components/AppLayout";
import { TwitterOutlined } from "@ant-design/icons";
import styled from 'styled'
const TwitterHeadIcon = styled(TwitterOutlined)`
  color: #00acee;
  font-size: 48px;
  padding: 10px;
`;

const Home = () => {
  return (
    <AppLayout>
      <div>Hello, NodeBird!
      <TwitterHeadIcon />

      </div>
    </AppLayout>
  );
};
export default Home;
